import React, { useState, useEffect } from 'react';
import { FaSearch, FaBed, FaBath, FaRulerCombined, FaMapMarkerAlt, FaHeart } from 'react-icons/fa';
import '../styles/Home.css'; 
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const Home = () => {
  const [activeSlide, setActiveSlide] = useState(0);
  const [searchParams, setSearchParams] = useState({
    type: 'buy',
    location: '',
    minPrice: '',
    maxPrice: '',
    beds: ''
  });

  // Featured properties data (would come from API in a real app)
  const featuredProperties = [
    {
      id: 1,
      title: 'Modern Apartment with Ocean View',
      image: '/images/property1.jpg',
      price: '$425,000',
      beds: 2,
      baths: 2,
      sqft: 1200,
      address: 'Downtown, Seattle'
    },
    {
      id: 2,
      title: 'Spacious Family Home',
      image: '/images/property2.jpg',
      price: '$750,000',
      beds: 4,
      baths: 3,
      sqft: 2800,
      address: 'Bellevue, WA'
    },
    {
      id: 3,
      title: 'Luxury Penthouse',
      image: '/images/property3.jpg',
      price: '$1,250,000',
      beds: 3,
      baths: 3.5,
      sqft: 3200,
      address: 'South Lake Union, Seattle'
    },
    {
      id: 4,
      title: 'Cozy Studio in the Heart of the City',
      image: '/images/property4.jpg',
      price: '$295,000',
      beds: 0,
      baths: 1,
      sqft: 550,
      address: 'Capitol Hill, Seattle'
    }
  ];

  // Neighborhood data
  const neighborhoods = [
    { id: 1, name: 'Downtown', image: '/images/downtown.jpg', priceRange: '$400K-$1.2M', trend: 'up' },
    { id: 2, name: 'Green Lake', image: '/images/greenlake.jpg', priceRange: '$600K-$1.5M', trend: 'stable' },
    { id: 3, name: 'Ballard', image: '/images/ballard.jpg', priceRange: '$550K-$1.4M', trend: 'up' },
  ];

  // Hero slider images
  const heroImages = [
    '/images/hero1.jpg',
    '/images/hero2.jpg',
    '/images/hero3.jpg'
  ];

  // Auto-rotate hero slider
  useEffect(() => {
    const interval = setInterval(() => {
      setActiveSlide((prev) => (prev + 1) % heroImages.length);
    }, 5000);
    
    return () => clearInterval(interval);
  }, [heroImages.length]);

  // Handle search form input changes
  const handleSearchChange = (e) => {
    const { name, value } = e.target;
    setSearchParams(prev => ({
      ...prev,
      [name]: value
    }));
  };

  // Handle search form submission
  const handleSearchSubmit = (e) => {
    e.preventDefault();
    console.log('Search params:', searchParams);
    // In a real app, you would navigate to search results page
  };

  return (
    <div>
      <Navbar />
    </div>
    
      
  );
};

export default Home;
